sys_variable_value.value:
(function execute(inputs, outputs) {

    var isMatch = false;
    var grRecord = new GlideRecord(inputs.strTableName);
    if (grRecord.isValid()) {
        if(grRecord.get(inputs.idRecord)) {
            isMatch = GlideFilter.checkRecord(grRecord, inputs.strEncodedQuery);
        }
    }

    outputs.match = isMatch;

})(inputs, outputs);

